import React from "react";
import { Nav } from "shards-react";

import Notifications from "./Notifications";
import UserActions from "./UserActions";

export default () => (
  <Nav  className="border-left flex-row" display='flex-end' >
    <Notifications />
    <UserActions />
  </Nav>
);
